import { ADD_TODO } from '../Actions/todo'

const initialState = {
    todoList: [{
        id: 12,
        content: "dmmm",
    }]
}

function todoApp(state = initialState, action) {
    switch (action.type) {
        case ADD_TODO:
            return {
                ...state,
                todoList: [...state.todoList, action.data],
            }
        default:
            return state;
    }
};

export default todoApp;
